// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title StarQuest Filecoin Storage Contract
 * @dev Handles AI training data storage on Filecoin with USDFC payments
 * Integrates with Synapse SDK for warm storage services
 */
contract StarQuestFilecoinStorage is Ownable, ReentrancyGuard {
    
    // USDFC Token interface
    IERC20 public usdfc;
    
    // State variables
    address public synapseSdk;
    address public starQuestCore;
    uint256 public storagePrice = 1e6; // 1 USDFC per GB per month
    uint256 public retrievalPrice = 0.1e6; // 0.1 USDFC per GB
    
    // Storage states
    enum StorageStatus { Pending, Stored, Retrieved, Expired }
    enum DataType { ChallengeData, AITrainingData, PlayerProofs, GameAssets }
    
    // Structs
    struct StorageRequest {
        bytes32 id;
        address requester;
        string cidHash; // IPFS/Filecoin CID
        DataType dataType;
        uint256 dataSize; // in bytes
        uint256 storageDuration; // in seconds
        uint256 cost; // in USDFC
        StorageStatus status;
        uint256 createdAt;
        uint256 expiresAt;
        string dealId; // Filecoin deal ID
        bool paid;
    }
    
    struct AIDataset {
        bytes32 id;
        string cidHash;
        string metadataCid;
        address contributor;
        uint256 size;
        uint256 rewardPool; // USDFC rewards for contributors
        uint256 accessPrice; // USDFC price for access
        bool verified;
        uint256 downloads;
        mapping(address => bool) hasAccess;
    }
    
    // Mappings
    mapping(bytes32 => StorageRequest) public storageRequests;
    mapping(bytes32 => AIDataset) public aiDatasets;
    mapping(address => bytes32[]) public userStorageRequests;
    mapping(address => bytes32[]) public userDatasets;
    mapping(DataType => uint256) public dataTypeCount;
    mapping(address => uint256) public userStorageBalance; // USDFC balance for storage
    
    // Events
    event StorageRequested(bytes32 indexed id, address indexed requester, string cidHash, uint256 cost);
    event StorageCompleted(bytes32 indexed id, string dealId);
    event DataRetrieved(bytes32 indexed id, address indexed retriever);
    event AIDatasetUploaded(bytes32 indexed id, address indexed contributor, string cidHash);
    event AIDatasetAccessed(bytes32 indexed id, address indexed accessor, uint256 cost);
    event PaymentReceived(address indexed payer, uint256 amount);
    event StorageBalanceUpdated(address indexed user, uint256 balance);
    
    // Modifiers
    modifier onlySynapse() {
        require(msg.sender == synapseSdk, "Only Synapse SDK");
        _;
    }
    
    modifier onlyStarQuestCore() {
        require(msg.sender == starQuestCore, "Only StarQuest core");
        _;
    }
    
    constructor(address _usdfc) {
        usdfc = IERC20(_usdfc);
    }
    
    /**
     * @dev Set contract addresses
     */
    function setContracts(address _synapseSdk, address _starQuestCore) external onlyOwner {
        synapseSdk = _synapseSdk;
        starQuestCore = _starQuestCore;
    }
    
    /**
     * @dev Set storage pricing
     */
    function setStoragePricing(uint256 _storagePrice, uint256 _retrievalPrice) external onlyOwner {
        storagePrice = _storagePrice;
        retrievalPrice = _retrievalPrice;
    }
    
    /**
     * @dev Deposit USDFC for storage services
     */
    function depositStorageBalance(uint256 amount) external {
        require(usdfc.transferFrom(msg.sender, address(this), amount), "Transfer failed");
        userStorageBalance[msg.sender] += amount;
        emit StorageBalanceUpdated(msg.sender, userStorageBalance[msg.sender]);
    }
    
    /**
     * @dev Request storage for game data
     */
    function requestStorage(
        string memory cidHash,
        DataType dataType,
        uint256 dataSize,
        uint256 storageDuration
    ) external returns (bytes32) {
        require(dataSize > 0, "Data size must be > 0");
        require(storageDuration > 0, "Storage duration must be > 0");
        
        // Calculate cost (dataSize in GB * duration in months * price per GB per month)
        uint256 sizeInGB = (dataSize + 1e9 - 1) / 1e9; // Round up to nearest GB
        uint256 durationInMonths = (storageDuration + 2592000 - 1) / 2592000; // Round up to nearest month
        uint256 totalCost = sizeInGB * durationInMonths * storagePrice;
        
        require(userStorageBalance[msg.sender] >= totalCost, "Insufficient balance");
        
        bytes32 requestId = keccak256(abi.encodePacked(msg.sender, cidHash, block.timestamp));
        
        storageRequests[requestId] = StorageRequest({
            id: requestId,
            requester: msg.sender,
            cidHash: cidHash,
            dataType: dataType,
            dataSize: dataSize,
            storageDuration: storageDuration,
            cost: totalCost,
            status: StorageStatus.Pending,
            createdAt: block.timestamp,
            expiresAt: block.timestamp + storageDuration,
            dealId: "",
            paid: false
        });
        
        // Deduct cost from user balance
        userStorageBalance[msg.sender] -= totalCost;
        storageRequests[requestId].paid = true;
        
        userStorageRequests[msg.sender].push(requestId);
        dataTypeCount[dataType]++;
        
        emit StorageRequested(requestId, msg.sender, cidHash, totalCost);
        return requestId;
    }
    
    /**
     * @dev Confirm storage completion (called by Synapse SDK)
     */
    function confirmStorage(bytes32 requestId, string memory dealId) external onlySynapse {
        StorageRequest storage request = storageRequests[requestId];
        require(request.status == StorageStatus.Pending, "Invalid status");
        
        request.status = StorageStatus.Stored;
        request.dealId = dealId;
        
        emit StorageCompleted(requestId, dealId);
    }
    
    /**
     * @dev Request data retrieval
     */
    function requestRetrieval(bytes32 requestId) external {
        StorageRequest storage request = storageRequests[requestId];
        require(request.status == StorageStatus.Stored, "Data not stored");
        require(block.timestamp < request.expiresAt, "Storage expired");
        
        // Calculate retrieval cost
        uint256 sizeInGB = (request.dataSize + 1e9 - 1) / 1e9;
        uint256 retrievalCost = sizeInGB * retrievalPrice;
        
        require(userStorageBalance[msg.sender] >= retrievalCost, "Insufficient balance for retrieval");
        
        // Deduct retrieval cost
        userStorageBalance[msg.sender] -= retrievalCost;
        request.status = StorageStatus.Retrieved;
        
        emit DataRetrieved(requestId, msg.sender);
    }
    
    /**
     * @dev Upload AI training dataset
     */
    function uploadAIDataset(
        string memory cidHash,
        string memory metadataCid,
        uint256 dataSize,
        uint256 accessPrice
    ) external returns (bytes32) {
        require(dataSize > 0, "Data size must be > 0");
        
        bytes32 datasetId = keccak256(abi.encodePacked(msg.sender, cidHash, block.timestamp));
        
        AIDataset storage dataset = aiDatasets[datasetId];
        dataset.id = datasetId;
        dataset.cidHash = cidHash;
        dataset.metadataCid = metadataCid;
        dataset.contributor = msg.sender;
        dataset.size = dataSize;
        dataset.accessPrice = accessPrice;
        dataset.verified = false;
        dataset.downloads = 0;
        
        userDatasets[msg.sender].push(datasetId);
        
        emit AIDatasetUploaded(datasetId, msg.sender, cidHash);
        return datasetId;
    }
    
    /**
     * @dev Purchase access to AI dataset
     */
    function purchaseDatasetAccess(bytes32 datasetId) external {
        AIDataset storage dataset = aiDatasets[datasetId];
        require(dataset.verified, "Dataset not verified");
        require(!dataset.hasAccess[msg.sender], "Already has access");
        require(dataset.accessPrice > 0, "Dataset is free");
        
        require(usdfc.transferFrom(msg.sender, address(this), dataset.accessPrice), "Payment failed");
        
        // Give access to dataset
        dataset.hasAccess[msg.sender] = true;
        dataset.downloads++;
        
        // Reward the contributor (80% to contributor, 20% to protocol)
        uint256 contributorReward = (dataset.accessPrice * 80) / 100;
        uint256 protocolFee = dataset.accessPrice - contributorReward;
        
        require(usdfc.transfer(dataset.contributor, contributorReward), "Contributor reward failed");
        dataset.rewardPool += contributorReward;
        
        emit AIDatasetAccessed(datasetId, msg.sender, dataset.accessPrice);
    }
    
    /**
     * @dev Verify AI dataset (only owner)
     */
    function verifyDataset(bytes32 datasetId, bool verified) external onlyOwner {
        aiDatasets[datasetId].verified = verified;
    }
    
    /**
     * @dev Get storage request details
     */
    function getStorageRequest(bytes32 requestId) external view returns (StorageRequest memory) {
        return storageRequests[requestId];
    }
    
    /**
     * @dev Get AI dataset details (excluding mapping)
     */
    function getAIDataset(bytes32 datasetId) external view returns (
        bytes32 id,
        string memory cidHash,
        string memory metadataCid,
        address contributor,
        uint256 size,
        uint256 rewardPool,
        uint256 accessPrice,
        bool verified,
        uint256 downloads
    ) {
        AIDataset storage dataset = aiDatasets[datasetId];
        return (
            dataset.id,
            dataset.cidHash,
            dataset.metadataCid,
            dataset.contributor,
            dataset.size,
            dataset.rewardPool,
            dataset.accessPrice,
            dataset.verified,
            dataset.downloads
        );
    }
    
    /**
     * @dev Check dataset access
     */
    function hasDatasetAccess(bytes32 datasetId, address user) external view returns (bool) {
        return aiDatasets[datasetId].hasAccess[user] || aiDatasets[datasetId].contributor == user;
    }
    
    /**
     * @dev Get user's storage requests
     */
    function getUserStorageRequests(address user) external view returns (bytes32[] memory) {
        return userStorageRequests[user];
    }
    
    /**
     * @dev Get user's datasets
     */
    function getUserDatasets(address user) external view returns (bytes32[] memory) {
        return userDatasets[user];
    }
    
    /**
     * @dev Get storage statistics
     */
    function getStorageStats() external view returns (
        uint256 totalChallengeData,
        uint256 totalAITrainingData,
        uint256 totalPlayerProofs,
        uint256 totalGameAssets
    ) {
        return (
            dataTypeCount[DataType.ChallengeData],
            dataTypeCount[DataType.AITrainingData],
            dataTypeCount[DataType.PlayerProofs],
            dataTypeCount[DataType.GameAssets]
        );
    }
    
    /**
     * @dev Emergency withdrawal (owner only)
     */
    function emergencyWithdraw() external onlyOwner {
        uint256 balance = usdfc.balanceOf(address(this));
        require(usdfc.transfer(owner(), balance), "Withdrawal failed");
    }
    
    /**
     * @dev Withdraw user storage balance
     */
    function withdrawStorageBalance(uint256 amount) external {
        require(amount <= userStorageBalance[msg.sender], "Insufficient balance");
        userStorageBalance[msg.sender] -= amount;
        require(usdfc.transfer(msg.sender, amount), "Transfer failed");
        emit StorageBalanceUpdated(msg.sender, userStorageBalance[msg.sender]);
    }
}

contracts/HTS.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";


// Hedera Token Service System Contract Interface
interface IHederaTokenService {
    function createFungibleToken(
        address token,
        uint256 initialTotalSupply,
        uint32 decimals,
        string memory name,
        string memory symbol
    ) external returns (int256 responseCode);
    
    function createNonFungibleToken(
        address token,
        string memory name,
        string memory symbol
    ) external returns (int256 responseCode);
    
    function mintToken(
        address token,
        uint64 amount,
        bytes[] memory metadata
    ) external returns (int256 responseCode, uint64 newTotalSupply, int64[] memory serialNumbers);
    
    function burnToken(
        address token,
        uint64 amount,
        int64[] memory serialNumbers
    ) external returns (int256 responseCode, uint64 newTotalSupply);
    
    function associateToken(address account, address token) external returns (int256 responseCode);
    
    function dissociateToken(address account, address token) external returns (int256 responseCode);
    
    function transferToken(
        address token,
        address from,
        address to,
        uint64 amount
    ) external returns (int256 responseCode);
    
    function transferNFT(
        address token,
        address from,
        address to,
        int64 serialNumber
    ) external returns (int256 responseCode);
}

/**
 * @title StarQuest HTS Integration Contract
 * @dev Hybrid EVM and Native Hedera Token Service integration
 * Creates and manages game tokens using HTS system contracts
 */
contract StarQuestHTS is Ownable, ReentrancyGuard {
    
    // Hedera Token Service system contract
    IHederaTokenService constant HTS = IHederaTokenService(0x0000000000000000000000000000000000000167);
    
    // Token addresses (will be set after creation)
    address public starQuestToken; // Main game token (fungible)
    address public starQuestNFT;   // Achievement NFTs (non-fungible)
    address public rewardToken;    // Reward distribution token
    
    // State variables
    address public starQuestCore;
    bool public tokensCreated = false;
    
    // Optimized structs
    struct TokenInfo {
        uint32 decimals;
        bool created;
    }
    
    struct NFTData {
        address owner;
        bytes metadata;
    }
    
    // Mappings
    mapping(address => TokenInfo) public tokenInfo;
    mapping(address => mapping(address => bool)) public tokenAssociations;
    mapping(address => mapping(int64 => NFTData)) public nftData;
    mapping(address => uint256) public userBalances;
    mapping(address => int64[]) public userNFTs;
    
    // Events
    event TokenCreated(address indexed token, string name, string symbol, bool isFungible);
    event TokenMinted(address indexed token, address indexed to, uint64 amount, int64[] serialNumbers);
    event TokenBurned(address indexed token, uint64 amount, int64[] serialNumbers);
    event TokenAssociated(address indexed user, address indexed token);
    event TokenTransferred(address indexed token, address indexed from, address indexed to, uint64 amount);
    event NFTTransferred(address indexed token, address indexed from, address indexed to, int64 serialNumber);
    
    // Modifiers
    modifier onlyStarQuestCore() {
        require(msg.sender == starQuestCore, "Core only");
        _;
    }
    
    modifier tokenExists(address token) {
        require(tokenInfo[token].created, "Token !exist");
        _;
    }
    
    constructor() {}
    
    /**
     * @dev Set StarQuest core contract
     */
    function setStarQuestCore(address _starQuestCore) external onlyOwner {
        starQuestCore = _starQuestCore;
    }
    
    /**
     * @dev Create the main game tokens using HTS
     */
    function createGameTokens() external onlyOwner {
        require(!tokensCreated, "Already created");
        
        // Create main game token
        starQuestToken = address(uint160(uint256(keccak256(abi.encodePacked(address(this), "SQ_TOKEN")))));
        int256 response1 = HTS.createFungibleToken(starQuestToken, 1000000 * 10**18, 18, "StarQuest Token", "SQ");
        require(response1 == 22, "Token creation failed");
        tokenInfo[starQuestToken] = TokenInfo({decimals: 18, created: true});
        
        // Create NFT token
        starQuestNFT = address(uint160(uint256(keccak256(abi.encodePacked(address(this), "SQ_NFT")))));
        int256 response2 = HTS.createNonFungibleToken(starQuestNFT, "StarQuest NFT", "SQNFT");
        require(response2 == 22, "NFT creation failed");
        tokenInfo[starQuestNFT] = TokenInfo({decimals: 0, created: true});
        
        // Create reward token
        rewardToken = address(uint160(uint256(keccak256(abi.encodePacked(address(this), "SQ_REWARD")))));
        int256 response3 = HTS.createFungibleToken(rewardToken, 10000000 * 10**18, 18, "StarQuest Rewards", "SQR");
        require(response3 == 22, "Reward creation failed");
        tokenInfo[rewardToken] = TokenInfo({decimals: 18, created: true});
        
        tokensCreated = true;
        
        emit TokenCreated(starQuestToken, "StarQuest Token", "SQ", true);
        emit TokenCreated(starQuestNFT, "StarQuest NFT", "SQNFT", false);
        emit TokenCreated(rewardToken, "StarQuest Rewards", "SQR", true);
    }
    
    /**
     * @dev Associate user with token
     */
    function associateUserWithToken(address user, address token) external returns (bool) {
        require(tokenInfo[token].created, "Token !exist");
        require(!tokenAssociations[user][token], "Already associated");
        
        int256 response = HTS.associateToken(user, token);
        if (response == 22) {
            tokenAssociations[user][token] = true;
            emit TokenAssociated(user, token);
            return true;
        }
        return false;
    }
    
    /**
     * @dev Mint fungible tokens
     */
    function mintFungibleTokens(address token, address to, uint64 amount) external tokenExists(token) returns (bool) {
        require(msg.sender == starQuestCore || msg.sender == owner(), "!authorized");
        require(tokenAssociations[to][token], "!associated");
        require(token == starQuestToken || token == rewardToken, "!fungible");
        
        bytes[] memory metadata = new bytes[](0);
        (int256 response, uint64 newSupply, int64[] memory serialNumbers) = HTS.mintToken(token, amount, metadata);
        
        if (response == 22) {
            userBalances[to] += amount;
            emit TokenMinted(token, to, amount, serialNumbers);
            return true;
        }
        return false;
    }
    
    /**
     * @dev Mint NFT with metadata
     */
    function mintNFT(address to, bytes memory metadata) external onlyStarQuestCore returns (int64) {
        require(tokenAssociations[to][starQuestNFT], "!associated");
        
        bytes[] memory metadataArray = new bytes[](1);
        metadataArray[0] = metadata;
        
        (int256 response, uint64 newSupply, int64[] memory serialNumbers) = HTS.mintToken(starQuestNFT, 1, metadataArray);
        
        if (response == 22 && serialNumbers.length > 0) {
            int64 serialNumber = serialNumbers[0];
            nftData[starQuestNFT][serialNumber] = NFTData({metadata: metadata, owner: to});
            userNFTs[to].push(serialNumber);
            emit TokenMinted(starQuestNFT, to, 1, serialNumbers);
            return serialNumber;
        }
        
        revert("Mint failed");
    }
    
    /**
     * @dev Transfer fungible tokens
     */
    function transferFungibleToken(address token, address from, address to, uint64 amount) external returns (bool) {
        require(msg.sender == from || msg.sender == starQuestCore || msg.sender == owner(), "!authorized");
        require(tokenAssociations[to][token], "!associated");
        require(userBalances[from] >= amount, "!balance");
        
        int256 response = HTS.transferToken(token, from, to, amount);
        
        if (response == 22) {
            userBalances[from] -= amount;
            userBalances[to] += amount;
            emit TokenTransferred(token, from, to, amount);
            return true;
        }
        return false;
    }
    
    /**
     * @dev Transfer NFT
     */
    function transferNFT(address from, address to, int64 serialNumber) external returns (bool) {
        require(msg.sender == from || msg.sender == starQuestCore || msg.sender == owner(), "!authorized");
        require(tokenAssociations[to][starQuestNFT], "!associated");
        require(nftData[starQuestNFT][serialNumber].owner == from, "!owner");
        
        int256 response = HTS.transferNFT(starQuestNFT, from, to, serialNumber);
        
        if (response == 22) {
            nftData[starQuestNFT][serialNumber].owner = to;
            
            // Update NFT arrays
            int64[] storage fromNFTs = userNFTs[from];
            for (uint256 i = 0; i < fromNFTs.length; i++) {
                if (fromNFTs[i] == serialNumber) {
                    fromNFTs[i] = fromNFTs[fromNFTs.length - 1];
                    fromNFTs.pop();
                    break;
                }
            }
            userNFTs[to].push(serialNumber);
            
            emit NFTTransferred(starQuestNFT, from, to, serialNumber);
            return true;
        }
        return false;
    }
    
    /**
     * @dev Burn fungible tokens
     */
    function burnFungibleTokens(address token, uint64 amount) external {
        require(userBalances[msg.sender] >= amount, "!balance");
        require(token == starQuestToken || token == rewardToken, "!fungible");
        
        int64[] memory serialNumbers = new int64[](0);
        (int256 response, uint64 newSupply) = HTS.burnToken(token, amount, serialNumbers);
        
        if (response == 22) {
            userBalances[msg.sender] -= amount;
            emit TokenBurned(token, amount, serialNumbers);
        }
    }
    
    // View functions
    function getUserTokenBalance(address user, address token) external view returns (uint256) {
        if (token == starQuestToken || token == rewardToken) {
            return userBalances[user];
        }
        return 0;
    }
    
    function getUserNFTs(address user) external view returns (int64[] memory) {
        return userNFTs[user];
    }
    
    function getNFTData(int64 serialNumber) external view returns (NFTData memory) {
        return nftData[starQuestNFT][serialNumber];
    }
    
    function isUserAssociatedWithToken(address user, address token) external view returns (bool) {
        return tokenAssociations[user][token];
    }
    
    function getTokenInfo(address token) external view returns (TokenInfo memory) {
        return tokenInfo[token];
    }
    
    /**
     * @dev Batch associate user with multiple tokens
     */
    function batchAssociateTokens(address user, address[] memory tokens) external returns (bool[] memory) {
        bool[] memory results = new bool[](tokens.length);
        
        for (uint256 i = 0; i < tokens.length; i++) {
            if (!tokenAssociations[user][tokens[i]] && tokenInfo[tokens[i]].created) {
                int256 response = HTS.associateToken(user, tokens[i]);
                if (response == 22) {
                    tokenAssociations[user][tokens[i]] = true;
                    emit TokenAssociated(user, tokens[i]);
                    results[i] = true;
                }
            }
        }
        return results;
    }
    
    /**
     * @dev Emergency token recovery (owner only)
     */
    function emergencyTokenRecovery(address token, address to, uint64 amount) external onlyOwner {
        require(tokenInfo[token].created, "!exist");
        int256 response = HTS.transferToken(token, address(this), to, amount);
        require(response == 22, "Recovery failed");
    }
    
    /**
     * @dev Get all created token addresses
     */
    function getAllTokens() external view returns (address[] memory) {
        address[] memory tokens = new address[](3);
        tokens[0] = starQuestToken;
        tokens[1] = starQuestNFT;
        tokens[2] = rewardToken;
        return tokens;
    }
}

contracts/Oracle.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";


/**
 * @title StarQuest Oracle Contract
 * @dev Oracle contract for external data feeds and AI verification
 * Integrates with Chainlink, Pyth, or other oracle services
 */
contract StarQuestOracle is Ownable, ReentrancyGuard {
    
    // State variables
    mapping(address => bool) public authorizedOracles;
    mapping(bytes32 => uint256) public priceFeeds; // Asset => Price (in wei)
    mapping(bytes32 => uint256) public lastUpdated;
    mapping(bytes32 => bool) public validAssets;
    
    address public starQuestCore;
    uint256 public constant PRICE_DECIMALS = 18;
    uint256 public constant MAX_PRICE_AGE = 3600; // 1 hour
    
    // Structs
    struct PriceData {
        uint256 price;
        uint256 timestamp;
        address oracle;
    }
    
    struct LocationData {
        int256 latitude;
        int256 longitude;
        uint256 accuracy;
        uint256 timestamp;
        address verifier;
    }
    
    // Mappings
    mapping(bytes32 => PriceData) public prices;
    mapping(bytes32 => LocationData) public locationVerifications;
    mapping(address => mapping(bytes32 => bool)) public oracleAssetAccess;
    
    // Events
    event PriceUpdated(bytes32 indexed asset, uint256 price, address oracle, uint256 timestamp);
    event LocationVerified(bytes32 indexed locationHash, int256 latitude, int256 longitude, address verifier);
    event OracleAuthorized(address indexed oracle, bool authorized);
    event AssetAdded(bytes32 indexed asset, string name);
    
    // Modifiers
    modifier onlyAuthorizedOracle() {
        require(authorizedOracles[msg.sender], "Not authorized oracle");
        _;
    }
    
    modifier onlyStarQuestCore() {
        require(msg.sender == starQuestCore, "Only StarQuest core");
        _;
    }
    
    modifier validAsset(bytes32 asset) {
        require(validAssets[asset], "Invalid asset");
        _;
    }
    
    constructor() {}
    
    /**
     * @dev Set StarQuest core contract
     */
    function setStarQuestCore(address _starQuestCore) external onlyOwner {
        starQuestCore = _starQuestCore;
    }
    
    /**
     * @dev Authorize oracle address
     */
    function authorizeOracle(address oracle, bool authorized) external onlyOwner {
        authorizedOracles[oracle] = authorized;
        emit OracleAuthorized(oracle, authorized);
    }
    
    /**
     * @dev Add valid asset for price feeds
     */
    function addAsset(bytes32 asset, string memory name) external onlyOwner {
        validAssets[asset] = true;
        emit AssetAdded(asset, name);
    }
    
    /**
     * @dev Grant oracle access to specific asset
     */
    function grantOracleAssetAccess(address oracle, bytes32 asset, bool access) external onlyOwner {
        oracleAssetAccess[oracle][asset] = access;
    }
    
    /**
     * @dev Update price feed (only authorized oracles)
     */
    function updatePrice(
        bytes32 asset, 
        uint256 price
    ) external onlyAuthorizedOracle validAsset(asset) {
        require(oracleAssetAccess[msg.sender][asset], "No access to this asset");
        require(price > 0, "Price must be greater than 0");
        
        prices[asset] = PriceData({
            price: price,
            timestamp: block.timestamp,
            oracle: msg.sender
        });
        
        lastUpdated[asset] = block.timestamp;
        
        emit PriceUpdated(asset, price, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Get latest price for asset
     */
    function getPrice(bytes32 asset) external view validAsset(asset) returns (uint256, uint256) {
        PriceData memory priceData = prices[asset];
        require(priceData.timestamp > 0, "Price not available");
        require(block.timestamp - priceData.timestamp <= MAX_PRICE_AGE, "Price too old");
        
        return (priceData.price, priceData.timestamp);
    }
    
    /**
     * @dev Verify location (called by authorized services)
     */
    function verifyLocation(
        bytes32 locationHash,
        int256 latitude,
        int256 longitude,
        uint256 accuracy
    ) external onlyAuthorizedOracle {
        locationVerifications[locationHash] = LocationData({
            latitude: latitude,
            longitude: longitude,
            accuracy: accuracy,
            timestamp: block.timestamp,
            verifier: msg.sender
        });
        
        emit LocationVerified(locationHash, latitude, longitude, msg.sender);
    }
    
    /**
     * @dev Get location verification data
     */
    function getLocationVerification(bytes32 locationHash) external view returns (LocationData memory) {
        return locationVerifications[locationHash];
    }
    
    /**
     * @dev Batch update multiple prices
     */
    function batchUpdatePrices(
        bytes32[] memory assets,
        uint256[] memory priceValues
    ) external onlyAuthorizedOracle {
        require(assets.length == priceValues.length, "Array length mismatch");
        
        for (uint256 i = 0; i < assets.length; i++) {
            require(validAssets[assets[i]], "Invalid asset");
            require(oracleAssetAccess[msg.sender][assets[i]], "No access to asset");
            require(priceValues[i] > 0, "Price must be greater than 0");
            
            prices[assets[i]] = PriceData({
                price: priceValues[i],
                timestamp: block.timestamp,
                oracle: msg.sender
            });
            
            lastUpdated[assets[i]] = block.timestamp;
            
            emit PriceUpdated(assets[i], priceValues[i], msg.sender, block.timestamp);
        }
    }
    
    /**
     * @dev Get multiple asset prices
     */
    function getMultiplePrices(bytes32[] memory assets) external view returns (uint256[] memory, uint256[] memory) {
        uint256[] memory priceValues = new uint256[](assets.length);
        uint256[] memory timestamps = new uint256[](assets.length);
        
        for (uint256 i = 0; i < assets.length; i++) {
            require(validAssets[assets[i]], "Invalid asset");
            PriceData memory priceData = prices[assets[i]];
            require(priceData.timestamp > 0, "Price not available");
            
            priceValues[i] = priceData.price;
            timestamps[i] = priceData.timestamp;
        }
        
        return (priceValues, timestamps);
    }
    
    /**
     * @dev Check if price is fresh
     */
    function isPriceFresh(bytes32 asset) external view returns (bool) {
        PriceData memory priceData = prices[asset];
        return priceData.timestamp > 0 && (block.timestamp - priceData.timestamp <= MAX_PRICE_AGE);
    }
    
    /**
     * @dev Emergency price update (only owner)
     */
    function emergencyPriceUpdate(bytes32 asset, uint256 price) external onlyOwner {
        require(validAssets[asset], "Invalid asset");
        require(price > 0, "Price must be greater than 0");
        
        prices[asset] = PriceData({
            price: price,
            timestamp: block.timestamp,
            oracle: msg.sender
        });
        
        lastUpdated[asset] = block.timestamp;
        
        emit PriceUpdated(asset, price, msg.sender, block.timestamp);
    }
}

